PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE loans (
	id INTEGER NOT NULL, 
	is_staff_pick BOOLEAN, 
	json BLOB, 
	PRIMARY KEY (id), 
	CHECK (is_staff_pick IN (0, 1))
);
CREATE TABLE recommendations (
	id INTEGER NOT NULL, 
	lender_id INTEGER, 
	loan_id INTEGER, 
	score INTEGER, 
	json BLOB, 
	PRIMARY KEY (id)
);
CREATE TABLE loan_lenders (
	id INTEGER NOT NULL, 
	json BLOB, 
	PRIMARY KEY (id)
);
CREATE TABLE lenders (
	id INTEGER NOT NULL, 
	facebook_id VARCHAR(200), 
	work VARCHAR(200), 
	location VARCHAR(200), 
	hometown VARCHAR(200), 
	username VARCHAR(200), 
	json BLOB, 
	PRIMARY KEY (id), 
	UNIQUE (facebook_id), 
	UNIQUE (username)
);
CREATE TABLE friends (
	lender_id INTEGER NOT NULL, 
	friend_id INTEGER NOT NULL, 
	PRIMARY KEY (lender_id, friend_id), 
	FOREIGN KEY(lender_id) REFERENCES lenders (id), 
	FOREIGN KEY(friend_id) REFERENCES lenders (id)
);
COMMIT;
